/* harmony default export */ var Rooming = ({
  name: 'Rooming',
  data: function data() {
    return {
      baseURL: this.baseURL.BASE_URL,
      inputData: '',
      signRoomLogo: '',
      dropzone: '',
      message: '用合约重构交易',
      interfaceCode: getTenant.getJSON('tenant')[1].interfaceCode,
      uploadData: {
        signRoomName: '用合约重构交易'
      },
      value1: '',
      value2: '',
      file: '',
      showImage: true
    };
  },

  methods: {
    urlloadUrl: function urlloadUrl() {
      return this.baseURL + '/restapi/wesign/v1/tenant/' + this.interfaceCode + '/signRoom/saveSignRoomInfo';
    },
    handleCopy: function handleCopy(text, event) {
      handleClipboard(text, event);
    },
    clipboardSuccess: function clipboardSuccess() {
      this.$message({
        message: '复制成功',
        type: 'success',
        duration: 1500
      });
    },
    handleChange: function handleChange(file, fileList) {
      this.file = file;
    },
    fileSuccess: function fileSuccess(name, file, fileList) {
      //上传文件，传参数 contractName contractNo 渲染 Contractsigning.vue
      this.signRoomLogo = file.name;
      this.showImg();
      if (this.signRoomLogo) {
        this.showImage = true;
      } else {
        this.showImage = false;
      }
    },

    // fileError(name, file, fileList){
    //   console.log(name,file,fileList)
    // },
    showImg: function showImg() {
      this.$http.post("http://testwesign.zqsign.com/restapi/wesign/" + 'v1/tenant/' + getTenant.getJSON('tenant')[1].interfaceCode + '/signRoom/showSignRoomInfo', { emulateJSON: true }).then(function (res) {

        if (res.data.sessionStatus == '0') {
          this.$router.push('/Server');
        } else {
          this.inputData = res.data.data.signRoomLink;
          this.signRoomLogo = res.data.data.signRoomLogo;
          if (res.data.data.signRoomName) {
            this.message = res.data.data.signRoomName;
          }
          if (this.signRoomLogo == null || this.signRoomLogo == 'null') {
            this.showImage = false;
          } else {
            this.showImage = true;
          }
        }
      });
    },
    saveImg: function saveImg() {
      this.$http.get("http://testwesign.zqsign.com/restapi/wesign/" + 'v1/tenant/' + getTenant.getJSON('tenant')[1].interfaceCode + '/signRoom/saveSignRoomName', { params: { 'signRoomName': this.message, 'saveState': '1' } }).then(function (res) {
        if (res.data.sessionStatus == '0') {
          this.$router.push('/Server');
        } else {
          var infoStatus = res.data.status; //签约室后台返回状态
          var infomessage = res.data.message; //签约室后台返回正确值
          if (infoStatus == true) {
            this.$message({
              message: infomessage,
              type: 'success'
            });
          }
        }
      });
    }
  },
  mounted: function mounted() {
    this.showImg();
  }
});
