  mounted: function mounted() {
    this.mobile = getTenant.getJSON('tenant')[0].mobile;
    this.companyName = getTenant.getJSON('tenant')[1].companyName;

    var authStatus = getTenant.getJSON('tenant')[0].authStatus; //是否通过状态  个人状态
    var auditSteps = getTenant.getJSON('tenant')[0].auditSteps; //个人认证步骤
    var auditStatus = getTenant.getJSON('tenant')[1].auditStatus; //企业通过状态
    var companySteps = getTenant.getJSON('tenant')[1].auditSteps; //企业认证步骤
    var status = getTenant.getJSON('tenant')[2].status; // 打款状态

    // 是否判断
    if (authStatus == '1') {
      this.authStatus = true;
    } else if (authStatus == '-1' && auditSteps == '1') {
      this.personalRealName = '1';
      this.chapter = '暂无签章';
      this.modalTips = true;
    } else if (authStatus == '-1' && auditSteps == '2') {
      this.personalRealName = '2';
      this.chapter = '暂无签章';
      this.modalTips = true;
    } else if (authStatus == '0' && auditSteps == '1') {
      this.personalRealName = '3';
      this.chapter = '暂无签章';
    } else if (authStatus == '0' && auditSteps == '2') {
      this.personalRealName = '4';
      this.chapter = '暂无签章';
    }
    if (this.authStatus == false) {
      this.auditStatus = true;
      this.identifier = true;
    } else {
      if (auditStatus == '2') {
        this.auditStatus = true;
        this.identifier = true;
      } else if (auditStatus == '-1' && companySteps == '1') {
        //填写企业信息
        this.enterpriseRealName = '0';
        this.chapter = '暂无签章';
        this.auditStatus = true;
      } else if (auditStatus == '0' && companySteps == '1') {
        //填写企业信息
        this.enterpriseRealName = '1';
        this.chapter = '暂无签章';
        this.identifier = true;
      } else if (auditStatus == '1' && companySteps == '1') {
        //银行信息
        this.enterpriseRealName = '2';
        this.chapter = '暂无签章';
        this.identifier = true;
      } else if (auditStatus == '1' && companySteps == '2') {
        //小额打款
        if (status == '0' || status == '1') {
          this.enterpriseRealName = '3';
          this.chapter = '暂无签章';
          this.identifier = true;
        } else if (status == '3') {
          //银行信息
          this.enterpriseRealName = '4';
          this.chapter = '暂无签章';
          this.identifier = true;
        } else {
          this.enterpriseRealName = '3';
          this.identifier = true;
        }
      }
    }

    // 意见  待定
    this.$http.get("http://testwesign.zqsign.com/restapi/wesign/" + 'v1.4/tenant/' + this.interfaceCode + '/auditStatus').then(function (res) {

      if (res.data.resultCode == '1') {
        // this.toEnterprise = res.data.data.verifyMoneyNum
        this.realNameState = true;
      } else {
        this.realNameState = false;
      }

      // this.toEnterprise = res.data.data.verifyMoneyNum
    });
    //  // 查询证书
    this.$http.get("http://testwesign.zqsign.com/restapi/wesign/" + 'v1.5/tenant/' + this.interfaceCode + '/getCertificate').then(function (res) {
      if (res.data.resultCode == '1') {
        this.serialNumber = res.data.data.userCode;
        this.issuedNumber = res.data.data.certificateNo;
        //   this.enterpriseName=res.data.data.companyName;
        this.companyName = res.data.data.companyName;
        // this.authName=res.data.data.userName;
        this.cardNumber = res.data.data.mobile;
        this.effectiveStartTime = res.data.data.certificateStartTime;
        this.effectiveEndTime = res.data.data.certificateDueTime;
      }
    });
    //  账户信息
    var accountCode = sessionStorage.getItem("accountCode");

    this.$http.get("http://testwesign.zqsign.com/restapi/wesign/" + 'v1.5/tenant/' + accountCode + '/getAccountInformation').then(function (res) {
      if (res.data.resultCode == '1') {

        this.mobile = res.data.data.mobile;
        this.accountName = res.data.data.accountName;
        this.Email = res.data.data.email;
        this.account = res.data.data.enterpriseName;
        this.authName = res.data.data.authorizerName;
        this.enterpriseName = res.data.data.enterpriseName;
        sessionStorage.setItem("authName", this.authName);
        this.b2bNum = res.data.data.b2bNum;
        this.b2cNum = res.data.data.b2cNum;
        this.ContractAllowance = Number(this.b2bNum) + Number(this.b2cNum);
      }
    });

    if (this.accountLevel == '1') {
      this.oneLever = true; //一级账号才去请求查询一级账号关联的所有二级账户信息

      this.searchSecondAccounts();
    } else {

      this.isShow = false;
      this.oneLever = false; //二级账号不查询，并且不显示账号管理模块
    }
    // 子账户信息

    //获取合同章
    this.searchSeal();

    //是否付费 0未付费 1付费
    var Status = getTenant.getJSON('tenant')[1].isBusiness;
    // console.log("Status"+Status)
    if (Status == '0') {
      this.Jurisdiction = false;
    } else {
      this.Jurisdiction = true;
    }
  }
